import avatar from '../assets/manpal.jpg';
import './Post.css';
import Avatar from '@material-ui/core/Avatar';

function Post() {
    return (
        <div className = "post">
            <h3>Username</h3>
            <Avatar 
                className = "post_avatar" 
                src = {avatar} alt="avtar"/>
            <img class = "post_image" src = {avatar} alt="avtar"/>
            <h4 className = "post_text" ><strong> manpal </strong>is live now user capion</h4>
        </div>
    )
}

export default Post;
